alias checkver {
  if ($beta) { checkver.startup forums.mirc.com /ubbthreads.php/topics/225704 }
  else { checkver.startup mirc.com /get.html }
  noop $dialog(checkver,checkver,-4)
}
alias wd { return $gettok($1,$2,$3) }
alias checkver.startup { set -u2 %2 $2 | sockclose checkver | sockopen -e checkver $1 443 }
on *:sockopen:checkver:{
  if ($sockerr) { did -ra checkver 2 There was a problem contacting the mIRC website. Please try again later. }
  else {
    sockwrite -n $sockname GET %2 HTTP/1.0
    sockwrite -n $sockname Host: www.mirc.com
    sockwrite -n $sockname Connection: close
    sockwrite -n $sockname $crlf
  }
}
on *:sockread:checkver:{
  var %g
  sockread %g
  if ($beta) && (!%nobeta) {
    if (The latest beta can be downloaded isin %g) {
      var %sockread = $remove($mid($wd($wd(%g,1,122),5,47),6),$chr(46)), %link = $wd($wd(%g,1,122),5,47)
      if (%sockread !isnum) { set -u3 %nobeta 1 | checkver.startup mirc.com /get.html }
      elseif ($mid(%sockread,4) != $beta) {
        did -ra checkver 2 An update for mIRC is available. Updates include security fixes, bug fixes, and new features. We recommend that you download and test this update now.
        did -ra checkver 3 mIRC $version $+ . $+ $mid(%sockread,4)
        did -a checkver 1 &Download
        did -v checkver 5,6
        set %url.get https://www.mirc.com/downloads/beta/ $+ %link $+ zip
        set %url.news https://forums.mirc.com/ubbthreads.php/topics/225704
      }
      else { did -ra checkver 2 No beta updates are available. }
      if (!%nobeta) { sockclose $sockname }
    }
  }
  else {
    if (<strong>mIRC isin %g) {
      var %sockread = $wd($wd(%g,3,118),1,60)
      if (%sockread !isnum) { did -ra checkver 2 There was a problem contacting the mIRC website. Please try again later. }
      elseif (%sockread != $version) {
        did -ra checkver 2 An update for mIRC is available. Updates include security fixes, bug fixes, and new features. We recommend that you download this update now.
        did -ra checkver 3 mIRC %sockread
        did -a checkver 1 &Download
        did -v checkver 5,6
        set %url.get https://www.mirc.com/get.php
        set %url.news https://www.mirc.com/news.html
      }
      else { did -ra checkver 2 No updates are available. }
      sockclose $sockname
    }
  }
}
