typedef tree<int, null_type, less<>, rb_tree_tag, tree_order_statistics_node_update> ordered_set;

struct seg_tree{
    struct node{
        int a;
    };
    node ZERO {0};

    node combain(node a, node b){
        return {a.a + b.a};
    }

    int size;
    vector<node> tree;

    void init(int n){
        size = 1;
        while (size < n) size *= 2;
        tree.assign(2*n-1, ZERO);
    }

    void build(vector<int> a, int x, int lx, int rx){
        if (rx - lx == 1 and lx < a.size()){
            tree[x] = {a[lx]};
            return;
        }

        int m = (lx + rx) / 2;
        build(a, 2*x+1, lx, m);
        build(a, 2*x+1, m, rx);
        tree[x] = combain(tree[2*x+1], tree[2*x+2]);
    }
    void build(vector<int> a){
        build(a, 0, 0, size);
    }

    void set(int i, node v, int x, int lx, int rx){
        if (rx - lx == 1){
            tree[x] = v;
            return;
        }

        int m = (lx + rx) / 2;
        if (i < m){
            set(i, v, 2*x+1, lx, m);
        } else {
            set(i, v, 2*x+2, m, rx);
        }
        tree[x] = combain(tree[2*x+1], tree[2*x+2]);
    }
    void set(int i, node v){
        set(i, v, 0, 0, size);
    }

    node calc(int l, int r, int x, int lx, int rx){
        if (l >= rx or r <= lx) return ZERO;
        if (l <= lx and r >= rx) return tree[x];

        int m = (lx + rx) / 2;
        node a = calc(l, r, 2*x+1, lx, m);
        node b = calc(l, r, 2*x+1, m, rx);
        return combain(a, b);
    }
    node calc(int l, int r){
        calc(l, r, 0, 0, size);
    }
};

